%define ENDL 0x0D, 0x0A, 0

; Clear Page
mov ah, 0x05
mov al, 1
int 0x10

mov si, game_start_text
call print

; Question
mov si, game_info_en
call print
mov si, game_info_tr
call print

call one_keyboard_for_enter

; Es segment to VRAM
mov ax, 0xA000
mov es, ax

; Video Mode 13h
xor ah, ah
mov al, 0x13
int 0x10

; Cursor unvisible
mov ah, 1
mov ch, 0x20
mov cl, 0x00
int 0x10

; Very Safe, OKEY XD 
xor cx, cx
xor di, di
xor si, si
xor bx, bx
xor ax, ax
xor dx, dx

; Temporary background
mov cx, 320*200
background:
    mov byte[es:bx], $35
    inc bx
    loop background
    xor bx, bx

