;;   Game Functions      ;;  
;;                       ;;
;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

; Test
floor:
    xor bx, bx
    mov cx, grass_size
    .soil:
        mov [chunk+bx], byte 2
        inc bx
        loop .soil
    mov cx, 450
    .grass:
        mov [chunk+bx], byte 1
        inc bx
        loop .grass
    ret

up:
    mov bx, [sel_character_cordinate]
    add bx, 450
    cmp [chunk+bx], byte 0
    jne up_ret

    call character_up_renderer

    mov bx, [sel_chunk_pixel]
    add bx, 450
    mov [sel_chunk_pixel], bx
    call camera

    mov si, character_speed-1
    call one_keyboard_loop

    mov [sel_animation_boolean], byte 0
    mov bx, [sel_chunk_pixel]
    call camera

    up_ret:
    ret

right:
    call character_right_renderer

    mov [sel_left], dword 0

    inc byte [sel_chunk_tick]
    dec byte [sel_chunk_pixel]
    mov bx, [sel_chunk_pixel]
    call camera

    ret

left:
    cmp [sel_chunk_tick], byte 2
    je .exit

    call character_left_renderer

    mov [sel_left], dword 1

    add [sel_chunk_pixel], byte 1
    mov bx, [sel_chunk_pixel]
    call camera
    dec byte [sel_chunk_tick]

    .exit:
    ret

character_right_renderer:
    mov bx, [sel_character_cordinate_end]
    dec bx
    cmp [chunk+bx], byte 0
    jne main_done
    mov bx, [sel_character_cordinate]
    dec bx
    cmp [chunk+bx], byte 0
    jne main_done

    call del_character_coridnater
    mov bx, [sel_character_cordinate]
    dec bx
    mov [sel_character_cordinate], bx
    call character_coridnater
    ret

character_left_renderer:
    mov bx, [sel_character_cordinate_end]
    inc bx
    cmp [chunk+bx], byte 0
    jne main_done
    mov bx, [sel_character_cordinate]
    inc bx
    cmp [chunk+bx], byte 0
    jne main_done


    call del_character_coridnater
    mov bx, [sel_character_cordinate]
    inc bx
    mov [sel_character_cordinate], bx
    call character_coridnater
    ret

character_up_renderer:
    call del_character_coridnater
    mov bx, [sel_character_cordinate]
    add bx, 450
    mov [sel_character_cordinate], bx
    call character_coridnater
    ret
down_character_physic:
    mov bx, [sel_character_cordinate_end]
    sub bx, 450
    cmp [chunk+bx], byte 0
    je .down
    ret
    .down:
        call del_character_coridnater
        mov bx, [sel_character_cordinate]
        sub bx, 450
        mov [sel_character_cordinate], bx
        call character_coridnater
        mov si, [sel_chunk_pixel]
        sub si, 450
        mov [sel_chunk_pixel], si
        mov bx, [sel_chunk_pixel]
        call camera
        jmp down_character_physic

;   Params:
;       bx = chunk cordinate
start_camera:
    mov [chunk+450*49+448], byte 5
    mov [chunk+450*48+448], byte 6
    mov [chunk+450*47+448], byte 1
    mov [chunk+450*47+447], byte 1
    mov [chunk+450*47+446], byte 1
    mov bx, [sel_chunk_pixel]
    call camera
    ret

camera:
    call camera_block_id_func

    ;mov di, camera_block_id
    ;mov bx, 320*9+10
    ;call out_temp_render

    call camera_pixel_db_engine

    call camera_renderer

    call character_renderer

    call sel_block_border

    ret

; "ENGÄ°NE" ðŸ¥¶
;   Params:
;       bx = chunk cordinate
camera_pixel_db_engine:
    pusha
    mov di, camera_pixel_db
    add di, 78
    mov cx, 5
    .main_loop:
        push cx
        mov cx, 8
        .loop:
            mov [di], bx
            sub di, 2
            inc bx
            loop .loop
        add bx, 450
        sub bx, 8
        pop cx
        loop .main_loop
    popa
    ret

;   Params:
;       bx = chunk cordinate
camera_block_id_func:
    pusha
    mov di, camera_block_id
    mov cx, 5
    .main_loop:
        push cx
        mov cx, 8
        .loop:
            mov si, [chunk+bx]
            mov [di], byte si
            inc di
            inc bx
            loop .loop
        add bx, 450
        sub bx, 8
        pop cx
        loop .main_loop
    popa
    ret

db_to_tx_namer:
    cmp [di], byte 1
    je .grass
    cmp [di], byte 2
    je .soil
    cmp [di], byte 3
    je .brick
    cmp [di], byte 5
    je .logo
    cmp [di], byte 6
    je .rose
    .done:
    ret
    .soil:
        mov si, tx_soil
        jmp .done
    .grass:
        mov si, tx_grass
        jmp .done
    .brick:
        mov si, tx_brick
        jmp .done
    .logo:
        mov si, tx_logo
        jmp .done
    .rose:
        mov si, tx_rose
        jmp .done

camera_renderer:
    xor bx, bx
    mov di, camera_block_id
    add di, 39
    mov cx, 5
    .main_loop:
        push cx
        mov cx, 8
        .loop:
            call db_to_tx_namer
            cmp [di], byte 0
            je .air
            cmp [di], byte 4
            je .air
            call one_block_renderer
            .done:
            add bx, 40
            dec di
            loop .loop
        add bx, 320*39
        pop cx
        loop .main_loop
    ret
    .air:
        call one_air_renderer
        jmp .done

;   Params:
;       bx = Camera start pixel cordinate for screen
;       si = Texture Name
one_block_renderer:
    pusha
    mov cx, 40
    .main_loop:
        push cx
        mov cx, 40
        .loop:
            mov di, [si]
            mov [es:bx], di
            inc bx
            inc si
            loop .loop
        add bx, 320
        sub bx, 40
        pop cx
        loop .main_loop
    popa
    ret

;   Params:
;       bx = Camera start pixel cordinate for screen
one_air_renderer:
    pusha
    mov cx, 40
    .main_loop:
        push cx
        mov cx, 40
        .loop:
            mov [es:bx], byte $35
            inc bx
            loop .loop
        add bx, 320
        sub bx, 40
        pop cx
        loop .main_loop
    popa
    ret

character_renderer:
    xor bx, bx
    mov di, camera_block_id
    add di, 39
    mov cx, 5
    .main_loop:
        push cx
        mov cx, 8
        .loop:
            cmp [di], byte 4
            je .render_main
            add bx, 40
            dec di
            loop .loop
        add bx, 320*39
        pop cx
        loop .main_loop
    .done:
    pop cx
    ret
    .render:
        cmp [sel_left], dword 0
        jne .render2
        mov di, tx_character_animation
        call ch_renderer
        mov di, 2
        call timer
        mov di, tx_character
        call ch_renderer
        mov di, 2
        call timer
        jmp .done
    .render2:
        mov di, tx_character_animation
        call ch_renderer_left
        mov di, 2
        call timer
        mov di, tx_character
        call ch_renderer_left
        mov di, 2
        call timer
        jmp .done
    .render_main:
        cmp [sel_animation_boolean], byte 0
        jne .render
        mov di, tx_character
        call ch_renderer
        jmp .done

;   Params:
;       bx = pixel cordinate from screen
;       di = chunk name
ch_renderer:
    pusha      
    mov cx, 80
    .main_loop:
        push cx
        mov cx, 40
        .loop:
            mov al, [di]
            mov [es:bx], al
            inc di
            inc bx
            loop .loop
        add bx, 320
        sub bx, 40
        pop cx
        loop .main_loop
    popa
    ret

;   Params:
;       bx = pixel cordinate from screen
;       di = chunk name
ch_renderer_left:
    pusha      
    mov cx, 80
    .main_loop:
        push cx
        mov cx, 40
        add di, 40
        .loop:
            mov al, [di]
            mov [es:bx], al
            dec di
            inc bx
            loop .loop
        add bx, 320
        sub bx, 40
        add di, 40
        pop cx
        loop .main_loop
    popa
    ret

init_character_cordinate_end: 
    mov si, [sel_character_cordinate]
    sub si, 450
    mov [sel_character_cordinate_end], si
    ret

del_character_coridnater:
    mov di, [sel_character_cordinate]
    mov [chunk+di], byte 0
    ret

character_coridnater:
    mov di, [sel_character_cordinate]
    mov [chunk+di], byte 4
    call init_character_cordinate_end
    ret

sel_block_border:
    xor bx, bx
    mov si, [sel_block_border_db]
    mov cx, 5
    .main_loop:
        push cx
        mov cx, 8
        .loop:
            cmp si, byte 0
            je .exit
            add bx, 40
            dec byte si
            loop .loop
        add bx, 320*39
        pop cx
        loop .main_loop
    .exit:
    pop cx
    call sel_block_border_renderer
    ret


sel_block_border_renderer:
    pusha
    push bx
    .y:
        mov cx, 2
        .main_loop:
            push cx
            mov cx, 40
            .loop:
                mov [es:bx], byte $28
                inc bx
                loop .loop
            add bx, 320*39
            sub bx, 40
            pop cx
            loop .main_loop
    pop bx
    .x:
        mov cx, 2
        .main_loop1:
            push cx
            mov cx, 40
            .loop1:
                mov [es:bx], byte $00
                add bx, 320
                loop .loop1
            add bx, 39
            sub bx, 320*40
            pop cx
            loop .main_loop1
    popa
    ret

sel_block_border_up:
    mov bx, [sel_block_border_db]
    cmp bx, 9
    jl .exit
    sub bx, 8
    mov [sel_block_border_db], bx
    mov bx, [sel_chunk_pixel]
    call camera
    .exit:
    ret

sel_block_border_right:
    mov bx, [sel_block_border_db]
    cmp bx, 39
    je .exit
    inc bx
    mov [sel_block_border_db], bx
    mov bx, [sel_chunk_pixel]
    call camera
    .exit:
    ret

sel_block_border_left:
    mov bx, [sel_block_border_db]
    cmp bx, 0
    je .exit
    dec bx
    mov [sel_block_border_db], bx
    mov bx, [sel_chunk_pixel]
    call camera
    .exit:
    ret

sel_block_border_down:
    mov bx, [sel_block_border_db]
    cmp bx, 31
    jg .exit
    add bx, 8
    mov [sel_block_border_db], bx
    mov bx, [sel_chunk_pixel]
    call camera
    .exit:
    ret

fill_block:
    mov bx, [sel_block_border_db]
    dec bx
    mov ax, 2
    mul bx
    mov bx, ax
    add bx, 2
    mov di, [camera_pixel_db+bx]
    mov [chunk+di], byte 3
    mov bx, [sel_chunk_pixel]
    call camera
    .exit:
    ret

del:
    mov bx, [sel_block_border_db]
    dec bx
    mov ax, 2
    mul bx
    mov bx, ax
    add bx, 2
    mov di, [camera_pixel_db+bx]
    mov [chunk+di], byte 0
    mov bx, [sel_chunk_pixel]
    call camera
    .exit:
    ret

