;;                       ;;
;;   Driver Functions    ;;  ðŸ˜­ (Not driver)
;;                       ;;
;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;;

; Bios Interrupt Keyboard; Because, irq is very fast and timer is bad :(
one_keyboard:
    xor si, si
    one_keyboard_loop:
    .loop:
        mov ah, 0
        int 0x16
        cmp al, 0x77
        je .left
        cmp al, 0x65
        je .right
        cmp al, 0x20
        je .up
        cmp al, 0x0D
        je .fill
        cmp ah, 0x53
        je .del
        cmp AH, 48h     
        je  .up_arrow
        cmp AH, 50h     
        je  .down_arrow
        cmp AH, 4Bh     
        je  .left_arrow
        cmp AH, 4Dh     
        je  .right_arrow
        ret
    .left:
        inc si
        cmp si, character_speed
        jne .loop
        xor si, si
        mov [sel_animation_boolean], byte 1
        call left
        ret
    .right:
        inc si
        cmp si, character_speed
        jne .loop
        xor si, si
        mov [sel_animation_boolean], byte 1
        call right
        ret
    .up:
        call up
        ret
    .fill:
        call fill_block
        ret
    .del:
        call del
        ret
    .up_arrow:
        call sel_block_border_up
        ret
    .down_arrow:
        call sel_block_border_down
        ret
    .left_arrow:
        call sel_block_border_left
        ret
    .right_arrow:
        call sel_block_border_right
        ret

one_keyboard_for_enter:
        mov ah, 0
        int 0x16
        cmp al, 0x0D
        je .ok
        jmp one_keyboard_for_enter
        .ok:
        ret

;   Timer; Using Bios Ä°nterrupt :[ 
;
;   Params:
;       di = Set tick (di / 18.2 = seconds)
;  
timer:
    cli
    pusha
    mov ah, 0
    int 1ah
    mov ah, 0
    int 1Ah
    mov bx, dx
    .wait:
        mov ah, 0
        int 1ah
        sub dx, bx
        cmp di, dx
        ja .wait
    popa
    sti
    ret

; Just Print 
print:
    lodsb               
    or al, al           
    jz .exit

    mov ah, 0x0E        
    mov bh, 0           
    int 0x10

    jmp print
    .exit:
    ret

